import React, { useState } from 'react';
import './index.css';
import { Link } from "react-router-dom";

const HomePage = () => {
    const [selectedTeam, setSelectedTeam] = useState(null);
    const teams = [
        { name: "CSK", className: "csk" },
        { name: "MI", className: "mi" },
        { name: "RCB", className: "rcb" },
        { name: "SRH", className: "srh" },
        { name: "RR", className: "rr" },
        { name: "LSG", className: "lsg" },
        { name: "GT", className: "gt" },
        { name: "PK", className: "pk" },
        { name: "DC", className: "dc" },
        { name: "KKR", className: "kkr" }
    ];

    const handleTeamClick = (team) => {
        setSelectedTeam(team);
        alert(`You selected ${team.name}`);
    };

    return (
        <div className="container">
            <header className="navbar-color">
                <img className="navbar-image" src="path/to/logo.png" alt="Logo" />
                <nav>
                    <Link to="/" className="nav-link">Home</Link>
                    <Link to="/about" className="nav-link">About</Link>
                    <Link to="/teams" className="nav-link">Teams</Link>
                </nav>
            </header>

            <div className="bc-image">
                <h1 className="textStyle">Welcome to the Team Selector</h1>
                <div className="row">
                    {teams.map((team) => (
                        <div 
                            key={team.name} 
                            className={`team ${team.className}`} 
                            onClick={() => handleTeamClick(team)}
                        >
                            <div className="team-name">{team.name}</div>
                        </div>
                    ))}
                </div>
            </div>

            <footer className="footer">
                <div className="footer-col">
                    <h4>Contact Us</h4>
                    <ul>
                        <li><a href="#">Email</a></li>
                        <li><a href="#">Phone</a></li>
                        <li><a href="#">Social Media</a></li>
                    </ul>
                </div>
                <div className="footer-col">
                    <h4>About</h4>
                    <ul>
                        <li><a href="#">Our Team</a></li>
                        <li><a href="#">Careers</a></li>
                    </ul>
                </div>
                <div className="footer-col">
                    <h4>Follow Us</h4>
                    <ul className="social-links">
                        <li><a href="#">Facebook</a></li>
                        <li><a href="#">Twitter</a></li>
                        <li><a href="#">Instagram</a></li>
                    </ul>
                </div>
            </footer>
        </div>
    );
};

export default HomePage;
